export const homeRoute = (query?: any) => ({ pathname: '/', query })
export const aboutRoute = (query?: any) => ({ pathname: '/about', query })//query: { name: 'ZEIT' }
export const productRoute = (query?: any) => ({ pathname: '/products/[id]', query })//query: { name: 'ZEIT' }
